import React from "react";
import Movie from "./Movie/Movie";

const Movies = (props) => {


  return (
    <ul>
      {props.movies.map((movie) => { return (
        <Movie key={movie.id} movie={movie} delMovie={props.delMovie}/>);
      })}
    </ul>
  );
};

export default Movies;
